const JIKAN_API_BASE = 'https://api.jikan.moe/v4';
// ==========================================
// 2. HELPER FUNCTIONS (RETRY LOGIC)
// ==========================================
const delay = (ms)=>new Promise((resolve)=>setTimeout(resolve, ms));
// Fungsi Fetch Pintar dengan Auto-Retry
async function fetchWithRetry(url, options, retries = 3, backoff = 1000) {
    try {
        // Delay awal kecil untuk mencegah spamming request
        await delay(300);
        const res = await fetch(url, options);
        // Jika sukses atau error biasa (404), kembalikan response
        if (res.status !== 429) {
            return res;
        }
        // Jika kena Rate Limit (429) DAN masih punya sisa retry
        if (retries > 0) {
            console.warn(`[API] Rate limit hit for ${url}. Retrying in ${backoff}ms...`);
            await delay(backoff);
            // Coba lagi dengan delay yang lebih lama (Exponential Backoff)
            return fetchWithRetry(url, options, retries - 1, backoff * 2);
        }
        return res;
    } catch (error) {
        // Jika error jaringan, coba retry juga
        if (retries > 0) {
            await delay(backoff);
            return fetchWithRetry(url, options, retries - 1, backoff * 2);
        }
        throw error;
    }
}
